import React, { Component } from 'react'

 class Resume extends Component {
    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-md-12 jumbotron text-center">
                        <h1>Resume</h1>
                    </div>
                </div>
                
            </div>
        )
    }
}

export default Resume;
